import React from 'react';
import Grid from '@material-ui/core/Grid';
import ShoppingCart from '@material-ui/icons/ShoppingCart';
import './App.css';

/**
 * create main app component of the application
 * @return {JSX} main component of the application
 */
function App() {
  return (
    <div>
      <Grid container direction="row" spacing={2}>
        <Grid item xs={2}>
          <img className="logo" src={process.env.PUBLIC_URL + '/koala.png'} />
        </Grid>
        <Grid item xs={10} container direction="row"
          justify="center" alignItems="center" spacing={3}>
          <Grid item xs={6}>
            <p className="title">Animal Cards</p>
          </Grid>
          <Grid item xs={6} alignItems="right">
            <ShoppingCart />
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
